create table asset (
	asset_id INT PRIMARY KEY GENERATED ALWAYS AS IDENTITY,
	serial_number VARCHAR(50),
	register_date DATE,
	building VARCHAR(50),
	received_date DATE,
	product_name VARCHAR(50),
	quantity INT,
	pic1 VARCHAR(500),
	pic2 VARCHAR(500),
	pic3 VARCHAR(500),
	pic4 VARCHAR(500),
	pic5 VARCHAR(500),
	is_package VARCHAR(50)
);
